                    prolog: [prolog, llm `D1`.asContent()],
                },
                {
                    context: [],
                    instruction: instruction,
                    prolog: [prolog, llm `D2`.asContent()],
                },
                {
                    context: [],
                    instruction: instruction,
                    prolog: [prolog, llm `D3`.asContent()],
                },
