            const expectedMapped = [
                llm `zero`.asContent(),
                list("id", [
                    list("a", [llm `A1`.asContent(), llm `instruction`.asContent()], [llm `A2`.asContent(), llm `instruction`.asContent()], [llm `A3`.asContent(), llm `instruction`.asContent()]),
                    list("b", [llm `B1`.asContent(), llm `instruction`.asContent()], [llm `B2`.asContent(), llm `instruction`.asContent()], [llm `B3`.asContent(), llm `instruction`.asContent()]),
                    list("c", [llm `C1`.asContent(), llm `instruction`.asContent()], [llm `C2`.asContent(), llm `instruction`.asContent()], [llm `C3`.asContent(), llm `instruction`.asContent()]),
                    list("d", [llm `D1`.asContent(), llm `instruction`.asContent()], [llm `D2`.asContent(), llm `instruction`.asContent()], [llm `D3`.asContent(), llm `instruction`.asContent()]),
