            const instruction = llm `instruction`.asContent();
            const contents = [llm `zero`.asContent(), list("id", "one", "two")];
            const expected = [
                llm `zero`.asContent(),
                list("id", [llm `one`.asContent(), llm `instruction`.asContent()], [llm `two`.asContent(), llm `instruction`.asContent()]),
