            const instruction = llm `${list("id", "foo", "bar")} baz`.asContent();
            const contents = [llm `zero`.asContent(), list("id", "one", "two")];
            const expected1 = [
                llm `zero`.asContent(),
                list("id", [llm `one`.asContent(), llm `foo baz`.asContent()], [llm `two`.asContent(), llm `bar baz`.asContent()]),
            ];
            const result1 = await fanOutContext(instruction, contents, async (i) => i);
            expect(result1).deep.eq(expected1);
            const expected2 = [
                llm `zero`.asContent(),
                list("id", [
                    llm `one`.asContent(),
                    llm `foo baz`.asContent(),
                    llm `foo baz`.asContent(),
                ], [
                    llm `two`.asContent(),
                    llm `bar baz`.asContent(),
                    llm `bar baz`.asContent(),
                ]),
            ];
            const result2 = await fanOutContext(instruction, result1, async (i) => i);
            expect(result2).deep.eq(expected2);
        });
    });
    suite("flattenContext", async () => {
        test("flattens multi-item context", async () => {
            const input = [
                llm `zero`.asContent(),
                list("id", [
                    llm `one`.asContent(),
                    llm `foo baz`.asContent(),
                    llm `foo baz`.asContent(),
                ], [
                    llm `two`.asContent(),
                    llm `bar baz`.asContent(),
                    llm `bar baz`.asContent(),
                ]),
            ];
            const expected = [
                llm `zero`.asContent(),
                llm `onetwo`.asContent(),
                llm `foo bazbar baz`.asContent(),
                llm `foo bazbar baz`.asContent(),
            ];
            const result = flattenContext(input);
            expect(result).deep.eq(expected);
        });
    });
    await runTests();
    return {};
}

