/**
 * @fileoverview Add a description for your module here.
 */

import { expect } from "./chai";
import { suite, test, runTests } from "./test";
import { fanOutContext, flattenContext, ListExpander } from "./a2/lists";
import { list } from "./utils";
import { llm } from "./a2/utils";

export default async function invoke() {
  suite("ListExpander", () => {
    test("handles nested lists in context", async () => {
      const instruction = llm`instruction`.asContent();
      const nestedA = [list("a", "A1", "A2", "A3")];
      const nestedB = [list("b", "B1", "B2", "B3")];
      const nestedC = [list("c", "C1", "C2", "C3")];
      const nestedD = [list("d", "D1", "D2", "D3")];
      const prolog = llm`zero`.asContent();
      const context = [prolog, list("id", nestedA, nestedB, nestedC, nestedD)];

      const expected = [
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`A1`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`A2`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`A3`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`B1`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`B2`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`B3`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`C1`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`C2`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`C3`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`D1`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`D2`.asContent()],
        },
        {
          context: [],
          instruction: instruction,
          prolog: [prolog, llm`D3`.asContent()],
        },
      ];

      const expectedMapped = [
        llm`zero`.asContent(),
        list("id", [
          list(
            "a",
            [llm`A1`.asContent(), llm`instruction`.asContent()],
            [llm`A2`.asContent(), llm`instruction`.asContent()],
            [llm`A3`.asContent(), llm`instruction`.asContent()]
          ),
          list(
            "b",
            [llm`B1`.asContent(), llm`instruction`.asContent()],
            [llm`B2`.asContent(), llm`instruction`.asContent()],
            [llm`B3`.asContent(), llm`instruction`.asContent()]
          ),
          list(
            "c",
            [llm`C1`.asContent(), llm`instruction`.asContent()],
            [llm`C2`.asContent(), llm`instruction`.asContent()],
            [llm`C3`.asContent(), llm`instruction`.asContent()]
          ),
          list(
            "d",
            [llm`D1`.asContent(), llm`instruction`.asContent()],
            [llm`D2`.asContent(), llm`instruction`.asContent()],
            [llm`D3`.asContent(), llm`instruction`.asContent()]
          ),
        ]),
      ];

      const expander = new ListExpander(instruction, context);
      expander.expand();
      expect(expander.list()).deep.eq(expected);

      // TODO: Start work on this again when 
      // const mapped = await expander.map(async (i) => i);
      // expect(mapped).deep.eq(expectedMapped);
    });
  });

  suite("fanOutContext", () => {
    test("passes through non-list context", async () => {
      const instruction = llm`i`.asContent();
      const c = llm`plain`.asContent();
      const f = await fanOutContext(instruction, [c], async (i) => {
        return i;
      });
      expect(f).deep.eq([c, instruction]);
    });

    test("fans out empty context with list instruction", async () => {
      const instruction = llm`${list("id", "foo", "bar")} baz`.asContent();
      const expected = [list("id", "foo baz", "bar baz")];

      const result1 = await fanOutContext(instruction, [], async (i) => i);
      expect(result1).deep.eq(expected);
      const result2 = await fanOutContext(
        instruction,
        undefined,
        async (i) => i
      );
      expect(result2).deep.eq(expected);
    });

    test("handles multiple lists in instruction w/empty context", async () => {
      const instruction =
        llm`${list("id", "foo", "bar")} baz ${list("id", "quz", "zorp")}`.asContent();
      const expected = [list("id", "foo baz quz", "bar baz zorp")];

      const result1 = await fanOutContext(instruction, [], async (i) => i);
      expect(result1).deep.eq(expected);
    });

    test("handles plain instruction w/list in context", async () => {
      const instruction = llm`instruction`.asContent();
      const contents = [llm`zero`.asContent(), list("id", "one", "two")];
      const expected = [
        llm`zero`.asContent(),
        list(
          "id",
          [llm`one`.asContent(), llm`instruction`.asContent()],
          [llm`two`.asContent(), llm`instruction`.asContent()]
        ),
      ];
      const result = await fanOutContext(instruction, contents, async (i) => i);
      expect(result).deep.eq(expected);
    });

    test("handles lists in instruction and context", async () => {
      const instruction = llm`${list("id", "foo", "bar")} baz`.asContent();
      const contents = [llm`zero`.asContent(), list("id", "one", "two")];

      const expected1 = [
        llm`zero`.asContent(),
        list(
          "id",
          [llm`one`.asContent(), llm`foo baz`.asContent()],
          [llm`two`.asContent(), llm`bar baz`.asContent()]
        ),
      ];
      const result1 = await fanOutContext(
        instruction,
        contents,
        async (i) => i
      );
      expect(result1).deep.eq(expected1);

      const expected2 = [
        llm`zero`.asContent(),
        list(
          "id",
          [
            llm`one`.asContent(),
            llm`foo baz`.asContent(),
            llm`foo baz`.asContent(),
          ],
          [
            llm`two`.asContent(),
            llm`bar baz`.asContent(),
            llm`bar baz`.asContent(),
          ]
        ),
      ];
      const result2 = await fanOutContext(
        instruction,
        result1 as LLMContent[],
        async (i) => i
      );
      expect(result2).deep.eq(expected2);
    });
  });

  suite("flattenContext", async () => {
    test("flattens multi-item context", async () => {
      const input = [
        llm`zero`.asContent(),
        list(
          "id",
          [
            llm`one`.asContent(),
            llm`foo baz`.asContent(),
            llm`foo baz`.asContent(),
          ],
          [
            llm`two`.asContent(),
            llm`bar baz`.asContent(),
            llm`bar baz`.asContent(),
          ]
        ),
      ];

      const expected = [
        llm`zero`.asContent(),
        llm`onetwo`.asContent(),
        llm`foo bazbar baz`.asContent(),
        llm`foo bazbar baz`.asContent(),
      ];

      const result = flattenContext(input);
      expect(result).deep.eq(expected);
    });
  });

  await runTests();

  return {};
}

