export { list };
function list(id, ...args) {
    return {
        parts: [
            {
                id,
                list: args.map((arg) => {
                    const content = typeof arg === "string"
                        ? [
                            {
                                parts: [{ text: arg }],
                                role: "user",
                            },
                        ]
                        : arg;
                    return {
                        content,
                    };
                }),
            },
        ],
    };
}

