export { list };

function list(id: string, ...args: (string | LLMContent[])[]): LLMContent {
  return {
    parts: [
      {
        id,
        list: args.map((arg) => {
          const content: LLMContent[] =
            typeof arg === "string"
              ? [
                  {
                    parts: [{ text: arg }],
                    role: "user",
                  },
                ]
              : arg;
          return {
            content,
          };
        }),
      },
    ],
  };
}

