import output from "@output";

export type SuiteFunction = () => void;
export type TestFunction = () => Promise<void>;
export type TestDeclaration = {
  suite: string;
  name: string;
  fn: TestFunction;
};
export type LogType = "driver" | "fail" | "ok";

type AssertionError = {
  message: string;
  expected: unknown;
  actual: unknown;
};

export { suite, test, runTests };

let currentSuite: string | null = null;
let tests: TestDeclaration[] = [];

function suite(name: string, fn: SuiteFunction) {
  const nestedName = currentSuite;
  currentSuite = name;
  fn();
  currentSuite = nestedName;
}

function test(name: string, fn: TestFunction) {
  const suite = currentSuite || "Test";
  tests.push({ suite, name, fn });
}

function getIndicator(type: LogType) {
  switch (type) {
    case "driver":
      return "";
    case "fail":
      return "";
    case "ok":
      return "";
  }
}

async function log(type: LogType, title: string, ...message: string[]) {
  title = `${getIndicator(type)} ${title}`;

  await output({
    $metadata: { title },
    schema: {
      type: "object",
      properties: {
        messages: {
          title: " ",
          type: "string",
          format: "markdown",
        },
      },
    },
    messages: message.join("\n\n"),
  });
}

async function runTests() {
  await log("driver", "Start", "Running tests ...");
  let passed = 0;
  let failed = 0;

  for (const test of tests) {
    try {
      console.log(`Running test: ${test.suite} ${test.name}`);
      await test.fn();
      await log("ok", test.suite, test.name);
      passed++;
    } catch (e) {
      const error = e as AssertionError;
      console.error(`TEST FAILED ${test.suite} ${test.name}`);
      console.error(`EXPECTED`, error.expected);
      console.error(`ACTUAL`, error.actual);
      await log("fail", test.suite, test.name, error.message);
      failed++;
    }
  }

  await log(
    "driver",
    "End",
    `${failed + passed} tests completed`,
    `${failed} failed`,
    `${passed} passed`
  );
}
